var app = angular.module('app', ['ngRoute', 'angular-jsonrpc-client']);
app.factory('myCitiesFactory', function () {

    var service = {};
    service.setCities  = function (cities) {
        service.cities = cities;
    };
    service.cities = [];

    return service;
});
app.controller('homeController', ['$scope', 'jsonrpc', 'myCitiesFactory', function ($scope, jsonrpc, myCitiesFactory) {

    getCities = function () {
        jsonrpc.request('get_cities', {"key": "7c4073d1-ffd0-4e32-bd56-03829dc67126"})
            .then(function(result) {
                var sortCity = _.sortBy(result.data.result, function (o) {
                    return o.city_name;
                }) ;

                _.each(sortCity, function (item, index) {
                    if (item.districts && item.districts.length > 0) {
                       var sortDistrics =  _.sortBy(item.districts, function (o) {
                            return o.name;
                        }) ;
                       sortCity[index]['districts'] = sortDistrics;
                    }
                });

                $scope.cities = sortCity;
                myCitiesFactory.setCities($scope.cities);
                console.log('cities from factory', myCitiesFactory.cities);
                _.each($scope.cities, function (city) {
                    if(city.city_name === 'test'){
                    }else {
                       addNewMarker(city);
                    }
                })
            })
            .catch(function(error) {
                debugger;
               console.log(error);
            });
    };

    getCities();


    addNewMarker = function(city){

        map.addMarker({
            lat: city.lat,
            lng: city.lon,
            title: city.city_name,
            click: function (e) {
                console.log(e);
                alert('You clicked in this marker'. e.title);
            }
        });
    };

    var map = new GMaps({
        el: '#map',
        lat: 51,
        lng: 5,
        maxZoom: 5
    });

    map.addMarker({
        lat: -12.043333,
        lng: -77.028333,
        title: 'Lima',
        click: function (e) {
            console.log(e);
            alert('You clicked in this marker');
        }
    });


    $scope.sortByPopulation = function () {
        _.each($scope.cities, function (item, index) {
            var count = 0;
            if(item.districts && item.districts.length > 0){
                _.each(item.districts, function (district) {
                    count += Number(district.population);
                });
            }
            $scope.cities[index]['countPopulation'] = count;
        });
        $scope.cities = _.sortBy($scope.cities, function (obj) {
            return obj.countPopulation
        })
    }


}]);
function City() {
    this.city_name = '';
    this.city_id = '';
    this.lat = '';
    this.lon = '';
    this.districts = [];
}

app.controller('cityController', ['$scope', 'jsonrpc', '$location', '$routeParams', 'myCitiesFactory', function ($scope, jsonrpc, $location, $routeParams, myCitiesFactory) {

    $scope.city = new City();
    $scope.name = '';
    $scope.population = '';

    var getCity = function (id) {
        // По хорошему надо бы спросить, но не тут то было - метода нет
        // jsonrpc.request('get_city', {
        //     "key": "7c4073d1-ffd0-4e32-bd56-03829dc67126",
        //     "id": id
        // }).then(function (value) {
        //     console.log(value);
        // }).catch(function (error) {
        //     debugger;
        //     console.log(error);
        // });

        if (myCitiesFactory.cities.length === 0) {
            $location.path('/').replace();
        } else {
            var currentCity = _.find(myCitiesFactory.cities, function (o) {
                return o.city_id === Number(id);
            });
            $scope.city = currentCity;
        }
    };

    if ($routeParams && $routeParams.id) {
        getCity($routeParams.id);
    }

    $scope.addDistricts = function () {
        if (!$scope.city.districts) {
            $scope.city.districts = [];
        }
        saveDistricts();
    };

    var saveDistricts = function () {
        if ($scope.name && $scope.population && Number($scope.population) > 0) {
            jsonrpc.request('create_district', {
                "key": "7c4073d1-ffd0-4e32-bd56-03829dc67126",
                "city_id": $scope.city.city_id,
                "name": $scope.name,
                "population": Number($scope.population)
            })
                .then(function (value) {
                    $scope.city.districts.push({
                        name: $scope.name,
                        population: $scope.population,
                        district_id: value.data.result
                    });
                    $scope.name = '';
                    $scope.population = '';
                })
                .catch(function (error) {
                    debugger;
                    console.log(error);
                });
        } else {
            alert('Error: Population is not number !')
        }
    };

    $scope.save = function () {

        if ($scope.city && $scope.city.city_id) {
            jsonrpc.request('set_city', {
                "key": "7c4073d1-ffd0-4e32-bd56-03829dc67126",
                "city_id": $scope.city.city_id,
                "name": $scope.city.city_name,
                "lat": $scope.city.lat,
                "lon": $scope.city.lon
            })
                .then(function (value) {
                    console.log(value);
                    $location.path('/').replace();
                })
                .catch(function (error) {
                    debugger;
                    console.log(error);
                });

        } else {
            jsonrpc.request('create_city', {
                "key": "7c4073d1-ffd0-4e32-bd56-03829dc67126",
                "name": $scope.city.city_name,
                "lat": $scope.city.lat,
                "lon": $scope.city.lon
            })
                .then(function (value) {
                    console.log(value);
                    $location.path('/').replace();
                })
                .catch(function (error) {
                    debugger;
                    console.log(error);
                });
        }


    };

    $scope.isDisabled = function () {
        if (!$scope.city.city_name || !$scope.city.lat || !$scope.city.lon) {
            return true;
        }
    };
    $scope.isDelete = function () {
        return Number($scope.city.city_id) > 0;
    };


    $scope.editDistrict = function (index) {
        _.each($scope.city.districts, function (item, i) {
            if (index === i) {
                $scope.name = item.name;
                $scope.population = item.population;
                $scope.district_id = item.district_id;
                $scope.districtNowEdit = true;
            }
        })
    };

    $scope.saveDistrict = function () {
        if ($scope.district_id) {
            jsonrpc.request('set_district', {
                "key": "7c4073d1-ffd0-4e32-bd56-03829dc67126",
                "district_id": $scope.district_id,
                "name": $scope.name,
                "population": $scope.population
            })
                .then(function (value) {
                    _.each($scope.city.districts, function (item) {
                        if (item.district_id === $scope.district_id) {
                            item.name = $scope.name;
                            item.population = $scope.population;
                            $scope.districtNowEdit = false;
                            $scope.district_id = undefined;
                            $scope.name = '';
                            $scope.population = '';
                        }
                    })

                })
                .catch(function (error) {
                    console.log(error);
                });
        }
    };


    $scope.deleteDistrict = function () {
        if ($scope.district_id) {
            jsonrpc.request('delete_district', {
                "key": "7c4073d1-ffd0-4e32-bd56-03829dc67126",
                "district_id": $scope.district_id
            })
                .then(function (value) {
                    _.each($scope.city.districts, function (item) {
                        if (Number(item.district_id) === Number($scope.district_id)) {
                            _.each($scope.city.districts, function (it, index) {
                                if (Number(it.district_id) === Number($scope.district_id)) {
                                    $scope.city.districts.splice(index, 1);
                                }
                            });

                            $scope.districtNowEdit = false;
                            $scope.district_id = undefined;
                            $scope.name = '';
                            $scope.population = '';
                        }
                    })

                })
                .catch(function (error) {
                    console.log(error);
                });
        }

    };

    $scope.deleteCity = function () {
        if ($scope.city && $scope.city.city_id) {

            jsonrpc.request('delete_city', {
                "key": "7c4073d1-ffd0-4e32-bd56-03829dc67126",
                "city_id": $scope.city.city_id
            })
                .then(function (value) {
                    console.log(value);
                    $location.path('/').replace();
                })
                .catch(function (error) {
                    console.log(error);
                });
        }

    }


}]);

app.config(function ($routeProvider, jsonrpcConfigProvider) {
    jsonrpcConfigProvider.set({
        url: 'http://95.213.207.35:18000/api/',
        returnHttpPromise: true
    });
    $routeProvider
        .when('/', {
            templateUrl: 'js/home/home.controller.html',
            controller: 'homeController'
        })
        .when('/add', {
            templateUrl: 'js/city/city.controller.html',
            controller: 'cityController'
        })
        .when('/edit/:id', {
            templateUrl: 'js/city/city.controller.html',
            controller: 'cityController'
        })
        .otherwise({
            template: '<h1>404 no such page</h1>'
        })
});
